import '../style/card2.css'
// import book from '../book.json'

export default function Card2() {
  return (
    <div className='feed'>
        <div className="user" >
            <img src="https://via.placeholder.com/150" alt="book" />
            <h3>Username</h3>
            <p>Good</p>
            
        </div>
    </div>
  );
}
